import { useContext } from "react";
import { ThemeContext } from "./ItIsContext";

function ChildContext() {
  const theme = useContext(ThemeContext);

  return (
    <div>
      <p className={theme}> This is paragraph to test theme</p>
    </div>
  );
}

export default ChildContext;
